import React from 'react';
import ProjectList from './ProjectList';

const Home = () => {
    return (
        <main>
            <header>
                <div className='header-logo'>
                    <img src="../images/logo.svg"></img>
                    <h1>Luca Troger</h1>
                </div>
                <p>Web Developer & Designer</p>
                <ul>
                    <li><a href='https://www.linkedin.com/in/luca-troger-105a77346/'><img href='./public/images/LI-In-Bug.png'></img></a></li>
                    <li><a href=''>Home</a></li>
                    <li><a href=''>Home</a></li>
                </ul>
            </header>
            <ProjectList />
        </main>
    );
};

export default Home;
